import { StyleSheet } from 'react-native'
import { darkerBlue, co, stTropaz } from '../../styles/colors'

export default StyleSheet.create({
  title: {
    textAlign: 'center',
    fontWeight: 'bold',
    fontSize: 15,
    color: stTropaz
  },
  paragraph: {
    textAlign: 'center',
    fontSize: 13,
    color: darkerBlue
  },
  textInput: {
    padding: 5,
    borderRadius: 5,
    borderColor: darkerBlue,
    borderWidth: 2
  }
})
